import React, { useState } from "react";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faEye, faEyeSlash } from "@fortawesome/free-solid-svg-icons";

const AuthPage = () => {
  const [isLogin, setIsLogin] = useState(true);
  const [passwordVisible, setPasswordVisible] = useState(false);

  const togglePasswordVisibility = () => {
    setPasswordVisible(!passwordVisible);
  };

  return (
    <div style={{ maxWidth: "400px", margin: "auto", padding: "20px" }}>
      <div style={{ display: "flex", justifyContent: "space-between", marginBottom: "20px" }}>
        <button
          onClick={() => setIsLogin(true)}
          style={{
            padding: "10px 20px",
            border: "none",
            backgroundColor: isLogin ? "#9370DB" : "#f8f9fa", // Updated to Medium Purple
            color: isLogin ? "#fff" : "#333",
            cursor: "pointer",
          }}
        >
            Login me
        </button>
        <button
          onClick={() => setIsLogin(false)}
          style={{
            padding: "10px 20px",
            border: "none",
            backgroundColor: !isLogin ? "#9370DB" : "#f8f9fa", // Updated to Medium Purple
            color: !isLogin ? "#fff" : "#333",
            cursor: "pointer",
          }}
        >
          Create an account
        </button>
      </div>

      {isLogin ? (
        <form>
          <h2>I am already a customer </h2>
          <div style={{ marginBottom: "15px" }}>
            <label>Email address</label>
            <input
              type="email"
              placeholder="Email address"
              style={{
                width: "100%",
                padding: "10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
          </div>
          <div style={{ marginBottom: "15px", position: "relative" }}>
            <label>Password</label>
            <input
              type={passwordVisible ? "text" : "password"}
              placeholder="Password"
              style={{
                width: "100%",
                padding: "10px 40px 10px 10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
            <span
              onClick={togglePasswordVisibility}
              style={{
                position: "absolute",
                right: "10px",
                top: "35px",
                cursor: "pointer",
                color: "#555",
              }}
            >
              {passwordVisible ? (
                <FontAwesomeIcon icon={faEyeSlash} />
              ) : (
                <FontAwesomeIcon icon={faEye} />
              )}
            </span>
          </div>
          <button
            type="submit"
            style={{
              width: "100%",
              padding: "10px",
              backgroundColor: "#9370DB", // Updated to Medium Purple
              color: "#fff",
              border: "none",
              borderRadius: "4px",
              cursor: "pointer",
            }}
          >
            Login me
          </button>
        </form>
      ) : (
        <form>
          <h2>New customer</h2>
          <div style={{ marginBottom: "15px" }}>
            <label>First name</label>
            <input
              type="text"
              placeholder="PrÃ©nom"
              style={{
                width: "100%",
                padding: "10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
          </div>
          <div style={{ marginBottom: "15px" }}>
            <label>Last name</label>
            <input
              type="text"
              placeholder="Last name"
              style={{
                width: "100%",
                padding: "10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
          </div>
          <div style={{ marginBottom: "15px" }}>
            <label>Email address</label>
            <input
              type="email"
              placeholder="Email address"
              style={{
                width: "100%",
                padding: "10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
          </div>
          <div style={{ marginBottom: "15px", position: "relative" }}>
            <label>Password</label>
            <input
              type={passwordVisible ? "text" : "password"}
              placeholder="Password"
              style={{
                width: "100%",
                padding: "10px 40px 10px 10px",
                marginTop: "5px",
                border: "1px solid #ccc",
                borderRadius: "4px",
              }}
            />
            <span
              onClick={togglePasswordVisibility}
              style={{
                position: "absolute",
                right: "10px",
                top: "35px",
                cursor: "pointer",
                color: "#555",
              }}
            >
              {passwordVisible ? (
                <FontAwesomeIcon icon={faEyeSlash} />
              ) : (
                <FontAwesomeIcon icon={faEye} />
              )}
            </span>
          </div>
          <button
            type="submit"
            style={{
              width: "100%",
              padding: "10px",
              backgroundColor: "#9370DB", // Updated to Medium Purple
              color: "#fff",
              border: "none",
              borderRadius: "4px",
              cursor: "pointer",
            }}
          >
           Sign me up
          </button>
        </form>
      )}
    </div>
  );
};

export default AuthPage;
